"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[493],{3958:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2022/05/11/","metadata":{"permalink":"/PILOS-Docs/blog/2022/05/11/","source":"@site/blog/2022-05-11.md","title":"Abschaltung alte BBB und PILOS URLs","description":"Anfang Juni 2021 wurde die Infrastruktur von PILOS neu organisiert und alle R\xe4ume auf die neue PILOS Verwaltungsoberfl\xe4che umgezogen (siehe Wartungsmeldung vom 01.06.2021). Die alten Links konnten in den folgenden Monaten weiter verwendet werden.","date":"2022-05-11T00:00:00.000Z","formattedDate":"11. Mai 2022","tags":[],"readingTime":0.465,"hasTruncateMarker":false,"authors":[{"name":"Samuel Weirich","title":"Maintainer of PILOS","url":"https://www.thm.de/ges/fachbereich/profil/team/samuel-weirich","imageURL":"https://www.thm.de/ges/images/Mitarbeiter/Weirich2.jpg","key":"weirich"}],"frontMatter":{"title":"Abschaltung alte BBB und PILOS URLs","authors":"weirich"},"nextItem":{"title":"Umzug alte BBB und PILOS Systeme","permalink":"/PILOS-Docs/blog/2021/06/01/"}},"content":"Anfang Juni 2021 wurde die Infrastruktur von PILOS neu organisiert und alle R\xe4ume auf die neue PILOS Verwaltungsoberfl\xe4che umgezogen (siehe Wartungsmeldung vom 01.06.2021). Die alten Links konnten in den folgenden Monaten weiter verwendet werden.\\n\\nMit dem heutigen Tag (11.05.2022) werden diese alten URLs auf diese Wartungsseite umgeleitet. Die Nutzer werden nach einer Hinweismeldung weiterhin an den richtigen Raum weitergeleitet.\\n\\nAb dem 01.06.2022 werden die URLs mit den folgenden Domainnamen jedoch nicht mehr funktionieren!\\n\\n- 11.pilos-thm.de\\n- 11.pilos-thm.de\\n- roxy.pilos-thm.de\\n- bueros.pilos-thm.de\\n- meetings.pilos-thm.de\\n\\n**Sollten Sie noch alte Links verwenden, \xe4ndern Sie diese sofort!**"},{"id":"/2021/06/01/","metadata":{"permalink":"/PILOS-Docs/blog/2021/06/01/","source":"@site/blog/2021-06-01.mdx","title":"Umzug alte BBB und PILOS Systeme","description":"Die folgenden Dienste wurden am 31.05 und 01.06.2021 zu pilos.thm.de umgezogen:","date":"2021-06-01T00:00:00.000Z","formattedDate":"1. Juni 2021","tags":[],"readingTime":0.88,"hasTruncateMarker":false,"authors":[{"name":"Samuel Weirich","title":"Maintainer of PILOS","url":"https://www.thm.de/ges/fachbereich/profil/team/samuel-weirich","imageURL":"https://www.thm.de/ges/images/Mitarbeiter/Weirich2.jpg","key":"weirich"}],"frontMatter":{"title":"Umzug alte BBB und PILOS Systeme","authors":["weirich"]},"prevItem":{"title":"Abschaltung alte BBB und PILOS URLs","permalink":"/PILOS-Docs/blog/2022/05/11/"}},"content":"Die folgenden Dienste wurden am 31.05 und 01.06.2021 zu pilos.thm.de umgezogen:\\n- bbb.mni.thm.de\\n- 11.pilos-thm.de\\n- 11.pilos-thm.de\\n- roxy.pilos-thm.de\\n- bueros.pilos-thm.de\\n- meetings.pilos-thm.de\\n\\n**Wichtige Hinweise**\\n- Die alten Links zu den R\xe4umen funktionieren weiterhin, die Nutzer werden zu dem gleichen Raum in pilos.thm.de weitergeleitet. Sobald der umgezogene Raum in pilos.thm.de gel\xf6scht wird, wird auch die Weiterleitung aufgehoben.\\n- Die umgezogenen R\xe4ume erkennen Sie an dem Namenspr\xe4fix (BBB MNI) oder (Umzug PILOS ...).\\n- Bitte l\xf6schen Sie R\xe4ume, die Sie nicht mehr ben\xf6tigen oder entfernen das Namenspr\xe4fix.\\n- Es kann sein, dass durch die umgezogenen R\xe4ume Ihr Raumkontingent ersch\xf6pft ist. In diesem Fall l\xf6schen Sie bitte nicht mehr ben\xf6tigte R\xe4ume.\\n- Wenn Sie die Meldung \\"Die Nutzung der Raumart ist nur f\xfcr bestimmte Nutzergruppen genehmigt ...\\" sehen, liegt es entweder daran, dass der Raumeigent\xfcmer sich am neuen System noch nicht angemeldet hat oder vom System nicht als berechtigt erkannt wurde. Wenn es nicht ihren Raum betrifft, bitten Sie den Raumeigent\xfcmer sich am neuen System anzumelden. Sollte der Fehler bestehen bleiben, kontaktieren Sie bitte den Support unter pilos@thm.de"}]}')}}]);